    AnySlice:
      description: |
        FALSE represents not applicable for all slices. TRUE represents applicable for all slices.
      type: boolean
    NwdafEvent:
      anyOf:
      - enum:
        - SLICE_LOAD_LEVEL
        - NETWORK_PERFORMANCE
        - NF_LOAD
        - SERVICE_EXPERIENCE
        - UE_MOBILITY
        - UE_COMMUNICATION
        - QOS_SUSTAINABILITY
        - ABNORMAL_BEHAVIOUR
        - USER_DATA_CONGESTION
        - NSI_LOAD_LEVEL
        - DN_PERFORMANCE
        - DISPERSION
        - RED_TRANS_EXP
        - WLAN_PERFORMANCE
        - SM_CONGESTION
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are:\n- SLICE_LOAD_LEVEL: Indicates that the event\
        \ subscribed is load level information of Network Slice  \n- NETWORK_PERFORMANCE:\
        \ Indicates that the event subscribed is network performance information.\
        \  \n- NF_LOAD: Indicates that the event subscribed is load level and status\
        \ of one or several Network Functions.  \n- SERVICE_EXPERIENCE: Indicates\
        \ that the event subscribed is service experience.  \n- UE_MOBILITY: Indicates\
        \ that the event subscribed is UE mobility information.  \n- UE_COMMUNICATION:\
        \ Indicates that the event subscribed is UE communication information.  \n\
        - QOS_SUSTAINABILITY: Indicates that the event subscribed is QoS sustainability.\
        \  \n- ABNORMAL_BEHAVIOUR: Indicates that the event subscribed is abnormal\
        \ behaviour.  \n- USER_DATA_CONGESTION: Indicates that the event subscribed\
        \ is user data congestion information.  \n- NSI_LOAD_LEVEL: Indicates that\
        \ the event subscribed is load level information of Network Slice and the\
        \ optionally associated Network Slice Instance  \n- DN_PERFORMANCE: Indicates\
        \ that the event subscribed is DN performance information.  \n- DISPERSION:\
        \ Indicates that the event subscribed is dispersion information.  \n- RED_TRANS_EXP:\
        \ Indicates that the event subscribed is redundant transmission experience.\
        \  \n- WLAN_PERFORMANCE: Indicates that the event subscribed is WLAN performance.\
        \  \n- SM_CONGESTION: Indicates the Session Management Congestion Control\
        \ Experience information for specific DNN and/or S-NSSAI.\n"
    EventReportingRequirement:
      description: Represents the type of reporting that the subscription requires.
      example:
        timeAnaNeeded: 2000-01-23T04:56:07.000+00:00
        anaMetaInd:
          dataStatProps:
          - null
          - null
          dataWindow:
            startTime: 2000-01-23T04:56:07.000+00:00
            stopTime: 2000-01-23T04:56:07.000+00:00
          strategy: null
          aggrNwdafIds:
          - null
          - null
        anaMeta:
        - null
        - null
        accPerSubset:
        - null
        - null
        endTs: 2000-01-23T04:56:07.000+00:00
        maxSupiNbr: 0
        accuracy: null
        startTs: 2000-01-23T04:56:07.000+00:00
        maxObjectNbr: 0
        offsetPeriod: 0
        sampRatio: 60
      properties:
        accuracy:
          $ref: '#/components/schemas/Accuracy'
        accPerSubset:
          description: |
            Each element indicates the preferred accuracy level per analytics subset. It may be present if the "listOfAnaSubsets" attribute is present in the subscription request when the subscription event is NF_LOAD, UE_COMM, DISPERSION, NETWORK_PERFORMANCE, WLAN_PERFORMANCE, DN_PERFORMANCE or SERVICE_EXPERIENCE.
          items:
            $ref: '#/components/schemas/Accuracy'
          minItems: 1
          type: array
        startTs:
          description: string with format 'date-time' as defined in OpenAPI.
          format: date-time
          type: string
        endTs:
          description: string with format 'date-time' as defined in OpenAPI.
          format: date-time
          type: string
        offsetPeriod:
          description: |
            Offset period in units of seconds to the reporting time, if the value is negative means  statistics in the past offset period, otherwise a positive value means prediction in the  future offset period. May be present if the "repPeriod" attribute is included within the  "evtReq" attribute.
          type: integer
        sampRatio:
          description: "Unsigned integer indicating Sampling Ratio (see clauses 4.15.1\
            \ of 3GPP TS 23.502), expressed in percent. \n"
          maximum: 100
          minimum: 1
          type: integer
        maxObjectNbr:
          description: "Unsigned Integer, i.e. only value 0 and integers above 0 are\
            \ permissible."
          minimum: 0
          type: integer
        maxSupiNbr:
          description: "Unsigned Integer, i.e. only value 0 and integers above 0 are\
            \ permissible."
          minimum: 0
          type: integer
        timeAnaNeeded:
          description: string with format 'date-time' as defined in OpenAPI.
          format: date-time
          type: string
        anaMeta:
          items:
            $ref: '#/components/schemas/AnalyticsMetadata'
          minItems: 1
          type: array
        anaMetaInd:
          $ref: '#/components/schemas/AnalyticsMetadataIndication'
      type: object
    Accuracy:
      anyOf:
      - enum:
        - LOW
        - HIGH
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are:\n- LOW: Low accuracy.  \n- HIGH: High accuracy.\n"
    AnalyticsMetadata:
      anyOf:
      - enum:
        - NUM_OF_SAMPLES
        - DATA_WINDOW
        - DATA_STAT_PROPS
        - STRATEGY
        - ACCURACY
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: |
        Possible values are:
        - NUM_OF_SAMPLES: Number of data samples used for the generation of the output analytics.
        - DATA_WINDOW: Data time window of the data samples.
        - DATA_STAT_PROPS: Dataset statistical properties of the data used to generate the analytics.
        - STRATEGY: Output strategy used for the reporting of the analytics.
        - ACCURACY: Level of accuracy reached for the analytics.
    AnalyticsMetadataIndication:
      description: |
        Contains analytics metadata information requested to be used during analytics generation.
      example:
        dataStatProps:
        - null
        - null
        dataWindow:
          startTime: 2000-01-23T04:56:07.000+00:00
          stopTime: 2000-01-23T04:56:07.000+00:00
        strategy: null
        aggrNwdafIds:
        - null
        - null
      properties:
        dataWindow:
          $ref: '#/components/schemas/TimeWindow'
        dataStatProps:
          items:
            $ref: '#/components/schemas/DatasetStatisticalProperty'
          minItems: 1
          type: array
        strategy:
          $ref: '#/components/schemas/OutputStrategy'
        aggrNwdafIds:
          items:
            $ref: '#/components/schemas/NfInstanceId'
          minItems: 1
          type: array
      type: object
    DatasetStatisticalProperty:
      anyOf:
      - enum:
        - UNIFORM_DIST_DATA
        - NO_OUTLIERS
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: |
        Possible values are:
        - UNIFORM_DIST_DATA: Indicates the use of data samples that are uniformly distributed according to the different aspects of the requested analytics.
        - NO_OUTLIERS: Indicates that the data samples shall disregard data samples that are at the extreme boundaries of the value range.
    OutputStrategy:
      anyOf:
      - enum:
        - BINARY
        - GRADIENT
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: |
        Possible values are:
        - BINARY: Indicates that the analytics shall only be reported when the requested level of accuracy is reached within a cycle of periodic notification.
        - GRADIENT: Indicates that the analytics shall be reported according with the periodicity irrespective of whether the requested level of accuracy has been reached or not.
    NotificationMethod:
      anyOf:
      - enum:
        - PERIODIC
        - THRESHOLD
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are:\n- PERIODIC: The subscribe of NWDAF Event\
        \ is periodically. The periodic of the notification is identified by repetitionPeriod\
        \ defined in clause 5.1.6.2.3.  \n- THRESHOLD: The subscribe of NWDAF Event\
        \ is upon threshold exceeded.\n"
    MatchingDirection:
      anyOf:
      - enum:
        - ASCENDING
        - DESCENDING
        - CROSSED
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: |
        Possible values are:
        - ASCENDING: Threshold is crossed in ascending direction.
        - DESCENDING: Threshold is crossed in descending direction.
        - CROSSED: Threshold is crossed either in ascending or descending direction.
    ThresholdLevel:
      description: Represents a threshold level.
      example:
        svcExpLevel: 1.0246457
        nfStorageUsage: 2
        avgTrafficRate: avgTrafficRate
        avgPacketDelay: 1
        congLevel: 2
        nfCpuUsage: 9
        maxTrafficRate: maxTrafficRate
        maxPacketDelay: 1
        nfMemoryUsage: 3
        nfLoadLevel: 7
        avgPacketLossRate: 123
      properties:
        congLevel:
          type: integer
        nfLoadLevel:
          type: integer
        nfCpuUsage:
          type: integer
        nfMemoryUsage:
          type: integer
        nfStorageUsage:
          type: integer
        avgTrafficRate:
          description: |
            String representing a bit rate; the prefixes follow the standard symbols from The International System of Units, and represent x1000 multipliers, with the exception that prefix "K" is used to represent the standard symbol "k".
          pattern: ^\d+(\.\d+)? (bps|Kbps|Mbps|Gbps|Tbps)$
          type: string
        maxTrafficRate:
          description: |
            String representing a bit rate; the prefixes follow the standard symbols from The International System of Units, and represent x1000 multipliers, with the exception that prefix "K" is used to represent the standard symbol "k".
          pattern: ^\d+(\.\d+)? (bps|Kbps|Mbps|Gbps|Tbps)$
          type: string
        avgPacketDelay:
          description: |
            Unsigned integer indicating Packet Delay Budget (see clauses 5.7.3.4 and 5.7.4 of 3GPP TS 23.501), expressed in milliseconds.
          minimum: 1
          type: integer
        maxPacketDelay:
          description: |
            Unsigned integer indicating Packet Delay Budget (see clauses 5.7.3.4 and 5.7.4 of 3GPP TS 23.501), expressed in milliseconds.
          minimum: 1
          type: integer
        avgPacketLossRate:
          description: |
            Unsigned integer indicating Packet Loss Rate (see clauses 5.7.2.8 and 5.7.4 of 3GPP TS 23.501), expressed in tenth of percent.
          maximum: 1000
          minimum: 0
          type: integer
        svcExpLevel:
          description: string with format 'float' as defined in OpenAPI.
          format: float
          type: number
      type: object
    NsiIdInfo:
      description: Represents the S-NSSAI and the optionally associated Network Slice
        Instance(s).
      example:
        snssai:
          sd: sd
          sst: 29
        nsiIds:
        - null
        - null
      properties:
        snssai:
          $ref: '#/components/schemas/Snssai'
        nsiIds:
          items:
            $ref: '#/components/schemas/NsiId'
          minItems: 1
          type: array
      required:
      - snssai
      type: object
    QosRequirement:
      description: Represents the QoS requirements.
      example:
        resType: null
        gfbrUl: gfbrUl
        gfbrDl: gfbrDl
        per: per
        "5qi": 126
        pdb: 1
      oneOf:
      - required:
        - 5qi
      - required:
        - resType
      properties:
        "5qi":
          description: |
            Unsigned integer representing a 5G QoS Identifier (see clause 5.7.2.1 of 3GPP TS 23.501, within the range 0 to 255.
          maximum: 255
          minimum: 0
          type: integer
        gfbrUl:
          description: |
            String representing a bit rate; the prefixes follow the standard symbols from The International System of Units, and represent x1000 multipliers, with the exception that prefix "K" is used to represent the standard symbol "k".
          pattern: ^\d+(\.\d+)? (bps|Kbps|Mbps|Gbps|Tbps)$
          type: string
        gfbrDl:
          description: |
            String representing a bit rate; the prefixes follow the standard symbols from The International System of Units, and represent x1000 multipliers, with the exception that prefix "K" is used to represent the standard symbol "k".
          pattern: ^\d+(\.\d+)? (bps|Kbps|Mbps|Gbps|Tbps)$
          type: string
        resType:
          $ref: '#/components/schemas/QosResourceType'
        pdb:
          description: |
            Unsigned integer indicating Packet Delay Budget (see clauses 5.7.3.4 and 5.7.4 of 3GPP TS 23.501), expressed in milliseconds.
          minimum: 1
          type: integer
        per:
          description: |
            String representing Packet Error Rate (see clause 5.7.3.5 and 5.7.4 of 3GPP TS 23.501, expressed as a "scalar x 10-k" where the scalar and the exponent k are each encoded as one decimal digit.
          pattern: "^([0-9]E-[0-9])$"
          type: string
      type: object
    RetainabilityThreshold:
      description: Represents a QoS flow retainability threshold.
      example:
        relTimeUnit: null
        relFlowRatio: 93
        relFlowNum: 0
      oneOf:
      - allOf:
        - required:
          - relFlowNum
        - required:
          - relTimeUnit
      - required:
        - relFlowRatio
      properties:
        relFlowNum:
          description: "Unsigned Integer, i.e. only value 0 and integers above 0 are\
            \ permissible."
          minimum: 0
          type: integer
        relTimeUnit:
          $ref: '#/components/schemas/TimeUnit'
        relFlowRatio:
          description: "Unsigned integer indicating Sampling Ratio (see clauses 4.15.1\
            \ of 3GPP TS 23.502), expressed in percent. \n"
          maximum: 100
          minimum: 1
          type: integer
      type: object
    TimeUnit:
      anyOf:
      - enum:
